import React from "react";
// import { Parallax } from "react-scroll-parallax";
import {
  ContactContainer,
  ContactInner,
  ContactText,
  ContactEmail,
  ContactLinkedIn,
  Image,
} from "./ContactElements";
import Daruma from "../../images/Daruma.png";

const Contact = () => {
  return (
    <ContactContainer id="contact">
      <ContactText>
        <ul></ul>
        <li>複数の文字列が～</li>

        <li>流れてゆくよ～</li>

        <li>テキスト毎に～</li>

        <li>CSSも指定しちゃうよ～</li>
      </ContactText>
      <ContactInner>
        <ContactEmail>
          <a
            className="link"
            target="_blank"
            href="mailto:hashirizaki61@gmail.com"
          >
            Email
          </a>
        </ContactEmail>
        <ContactLinkedIn>
          <a
            className="link"
            target="_blank"
            href="https://www.linkedin.com/in/yuya-hashirizaki-9b0065191/"
          >
            LinkedIn
          </a>
        </ContactLinkedIn>
      </ContactInner>
    </ContactContainer>
  );
};

export default Contact;
